REPLACE INTO /* MW_PREFIX_PLACEHOLDER */content_fields (id,updated_at,created_at,created_by,edited_by,rel_type,rel_id,field,value) VALUES('25','2021-03-26 15:24:13','2021-03-26 15:24:13','1','1','content','15','content_body','How to write product descriptions that sell One of the best things you can do to make your store successful is invest some time in writing great product descriptions. You want to provide detailed yet concise information that will entice potential customers to buy.<br><br>Think like a consumer Think about what you as a consumer would want to know, then include those features in your description. For clothes: materials and fit. For food: ingredients and how it was prepared. Bullets are your friends when listing features!'); /* MW_QUERY_SEPERATOR */


